ttps://codepen.io/khamer/pen/eYBBrYz\">\r\n  Company Goals Generator</a> by Kevin Hamer (<a href=\"https://codepen.io/khamer\">@khamer</a>)\r\n  on <a href=\"https://codepen.io\">CodePen</a>.</span>\r\n</p>\r\n<script async src=\"https://cpwebassets.codepen.io/assets/embed/ei.js\"></script>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1821,2180,1,NULL,'2022-03-09 19:06:02','2022-03-09 19:06:02','c35bb337-9158-4dd2-86b5-09b55dbf362b',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1823,2183,1,NULL,'2022-03-09 19:06:02','2022-03-09 19:06:02','e25b1f91-b623-4043-91e8-61f083848a21',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1828,2192,1,NULL,'2022-03-09 19:06:04','2022-03-09 19:06:04','d4f8d91b-72b0-4e38-bd06-d929fd436c59',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1830,2195,1,'Using Content Designer','2022-03-11 19:48:32','2022-03-14 14:59:38','c1b35be1-667a-47f8-85e0-14cc7605f74a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p>While editing entries on your site, you may see a field called <strong>Content Designer</strong>. This field is is customized to your site and provides you a section by section way to layout and add content to your site.</p>\n<p>Within Content Designer, you can add one more Sections. Each section has it\'s own set of fields.</p>\n<h2>Content Designer Sections</h2>\n<h3>Common Fields</h3>\n<p>Some fields are common to most sections: <br /></p>\n\n\n\n<ul><li><strong>Section Eyebrow</strong></li><li><strong>Section Heading</strong><br /></li><li><strong>Section Subheading</strong></li><li><strong>Section Introduction</strong></li><li><strong>Section Conclusion</strong></li><li><strong>Section Call to Action</strong></li></ul><p>These are typically all optional. Most sections will only have content in a few of these fields. Filling in all of them will make your site look cluttered.</p>\n<h3>Designed Sections</h3>\n<p>Designed Sections will be the most common type of section used on your site. Designed sections all you to add up to two pieces of content within them:</p>\n<ul><li><strong>Text</strong> (rich text),</li><li>a <strong>Call to Action,</strong><br /></li><li>a <strong>Image,</strong></li><li>a <strong>Related Entry,</strong></li><li>a <strong>Video</strong> or</li><li>an <strong>Embed.</strong></li></ul><p>On mobile, these will be shown stacked. On larger screens, they\'ll typically be shown side by side in the other you\'ve added them.</p>\n<h3>Rich Text Sections</h3>\n<p>Rich Text sections are meant for regular text content. Besides the common fields, Rich Text sections have a single Content field that lets you add rich text. You can also add images or embeds within the rich text field, but they will be less designed and responsive than using a Designed Section.<br /></p>\n<h3>Call to Action Sections</h3>\n<p>Call to Action sections feature a dominant call to action. Call to Actions can also be added within a Designed Section for less emphasis.</p>\n<h3>Related Entries Sections</h3>\n<p>Related Entries show a set of related entries. For each entry, typically a title, image, description, and link are included. Related Entries can be added to Designed Sections alternatively.</p>\n<h3>Testimonial Sections</h3>\n<p>Testiominal Sections feature a dominant testimonial.</p>\n<h3>Icon Grid Sections</h3>\n<p>Icon Grids showcase several icons, logos, brands, or other emblems. </p>\n<h3>Shared Sections</h3>\n<p>There is a section with the CMS where you can <a href=\"/admin/entries/sharedSections\">define Shared Sections</a>. Each Shared Section can contain one or more sections. You might define a Shared Section that contains featured blog articles, a Call to Action to contact you, or a Designed Section with messaging about hiring.</p>\n<p>Then while editing other entries, you can use choose Shared Section in Content Designer to pick from of the Shared Sections you\'ve already built to include it into your page. This way, you can create and update a single Shared Section but have your changes reflected on every page using it.</p>'),(1831,2196,1,NULL,'2022-03-11 19:49:19','2022-03-11 19:52:17','a62e8993-795d-418d-bc53-860aae2cea0a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'{\"bundleVersion\":\"1.0.22\",\"sourceBundleType\":\"field\",\"sourceId\":null,\"sourceName\":null,\"sourceHandle\":null,\"sourceType\":\"field\",\"typeId\":null,\"sourceTemplate\":\"\",\"sourceSiteId\":null,\"sourceAltSiteSettings\":[],\"sourceDateUpdated\":\"2022-03-11T11:49:19-08:00\",\"metaGlobalVars\":{\"language\":null,\"mainEntityOfPage\":\"\",\"seoTitle\":\"\",\"siteNamePosition\":\"\",\"seoDescription\":\"\",\"seoKeywords\":\"\",\"seoImage\":\"\",\"seoImageWidth\":\"\",\"seoImageHeight\":\"\",\"seoImageDescription\":\"\",\"canonicalUrl\":\"\",\"robots\":\"\",\"ogType\":\"\",\"ogTitle\":\"\",\"ogSiteNamePosition\":\"\",\"ogDescription\":\"\",\"ogImage\":\"\",\"ogImageWidth\":\"\",\"ogImageHeight\":\"\",\"ogImageDescription\":\"\",\"twitterCard\":\"\",\"twitterCreator\":\"\",\"twitterTitle\":\"\",\"twitterSiteNamePosition\":\"\",\"twitterDescription\":\"\",\"twitterImage\":\"\",\"twitterImageWidth\":\"\",\"twitterImageHeight\":\"\",\"twitterImageDescription\":\"\",\"inherited\":[],\"overrides\":[]},\"metaSiteVars\":{\"siteName\":\"Padstone\